{'videoId': '1I6rrbxL6eg', 'topLevelComment': {'kind': 'youtube#comment', 'etag': 'zbRjZG8WVPIu-XL2sVf4qeS0cYY', 'id': 'UgzpVuc0Xbnx2161CBR4AaABAg', 'snippet': {'videoId': '1I6rrbxL6eg', 'textDisplay': 'Parece existir uma confusão na questão do identitarismo. Ninguém vê problema algum em um candidato que defende as pautas da classe trabalhadora concorrer, seja essa pessoa de que identidade for. Na vdd precisamos muito de mais pessoas que defendam as nossas pautas, as pautas da classe trabalhadora, que são principalmente, mas não apenas: melhores condições de trabalho, de melhores salários, melhor transporte, melhor saúde e educação públicas e gratuitas, PARA TODOS OS TRABALHADORES, etc. O problema é partido de esquerda colocar candidato que vai colocar pautas da sua identidade, seja ela qual for, na frente dos interesses gerais da classe trabalhadora, ou que vai unicamente defender as pautas identitárias, e vai votar contra as pautas dos trabalhadores em geral. Aí aparece um fulano lá, e diz que se candidata pq é preto, ou pq é homossexual, e que vai lutar por essas pautas. Não precisa ser nenhum gênio pra entender que isso aí não vai dar certo, e que vai deixar o trabalhador que acorda 5h da manhã pra pegar um trem lotado, e que não está inserido dentro do range identitário, puto da vida. Esse trabalhador vai ter a impressão de q os partidos que deveriam, supostamente, defender seus interesses de classe, estão de sacanagem com a cara dele.<br><br>Outra coisa. É óbvio que quem está inserido dentro do alcance das questões identitárias, terão menores salários, terão menos oportunidades, terão uma estabilidade fragilizada, mas isso acontece pq é um problema do capitalismo, ora. Não existem vagas de trabalho para todos em um mundo capitalista, até pq esta é uma questão fundamental do funcionamento do próprio capitalismo, pq no capitalismo não pode ter empregos para todos mesmo, o que força os trabalhadores a se inserirem dentro de um padrão estético pré-estabelecido pela própria burguesia, que é, de modo geral, homem branco hétero. É um problema cultural? É tmbm, mas é principalmente um problema do capitalismo. Para provar isso é muito simples, basta fazer um exercício de inversão da situação. Se existissem mais vagas de trabalho do que trabalhadores, haveria uma supervalorização da força de trabalho, e dos trabalhadores por consequência, os salários seriam valorizados, a estabilidade seria garantida, e seriam contratados quem fosse, seja de que minoria for, por causa da necessidade do preenchimento das vagas de trabalho. Pode-se tentar buscar remendos dentro do capitalismo, como estabilidade no trabalho para minorias, cotas para minorias, etc. Mas serão apenas remendos que podem ser facilmente revertidos, como foram vários direitos trabalhistas desde o golpe contra a Dilma. Não existem garantias sagradas para os trabalhadores no capitalismo que não possam ser revertidas em qualquer momento, seja ele de que identidade for, seja da minoria ou não. Mas mais do que isso, buscar esses remendos causa uma divisão no seio da classe trabalhadora. Sabemos que, no capitalismo, a própria falta de garantias e de posições no mercado de trabalho cria um cenário de todos contra todos, uma questão de sobrevivência que leva até à selvageria e ao barbarismo entre os próprios trabalhadores. Os trabalhadores que estão inseridos no mercado buscam vantagens que lhes permitam sobreviver nesta selva do capitalismo, e ele certamente vai entender políticas minoritárias como busca por vantagens, pq no fim das contas é o que acaba sendo mesmo. Ou existe outra explicação para pessoas brancas se declararem como pardas ou até pretas para receberem cotas, ou algum político se declarar homossexual, seja ele ou não, para receber uma vantagem política? E quem não está inserido dentro das minorias identitárias, mas tem o mínimo de caráter de não cometer estas falsidades, tmbm não vai ficar satisfeito. E toda essa explicação até aqui, tmbm serve ao entendimento de pq os pais da classe trabalhadora não querer q o filho seja homossexual, ou de pq prefere um homem, pq os pais querem que ele tenha mais chances de vencer na selva do capitalismo. É uma questão cultural, mas é um desdobramento do nosso modelo de produção social, o capitalismo. <br><br>Essas questões só podem ser resolvidas com a revolução socialista, e a revolução vai ser da classe trabalhadora UNIDA, ou não vai ser. Políticas identitárias servem apenas para dividir os trabalhadores, por isso mesmo a pergunta, se a questão identitária realmente veio da classe trabalhadora.', 'textOriginal': 'Parece existir uma confusão na questão do identitarismo. Ninguém vê problema algum em um candidato que defende as pautas da classe trabalhadora concorrer, seja essa pessoa de que identidade for. Na vdd precisamos muito de mais pessoas que defendam as nossas pautas, as pautas da classe trabalhadora, que são principalmente, mas não apenas: melhores condições de trabalho, de melhores salários, melhor transporte, melhor saúde e educação públicas e gratuitas, PARA TODOS OS TRABALHADORES, etc. O problema é partido de esquerda colocar candidato que vai colocar pautas da sua identidade, seja ela qual for, na frente dos interesses gerais da classe trabalhadora, ou que vai unicamente defender as pautas identitárias, e vai votar contra as pautas dos trabalhadores em geral. Aí aparece um fulano lá, e diz que se candidata pq é preto, ou pq é homossexual, e que vai lutar por essas pautas. Não precisa ser nenhum gênio pra entender que isso aí não vai dar certo, e que vai deixar o trabalhador que acorda 5h da manhã pra pegar um trem lotado, e que não está inserido dentro do range identitário, puto da vida. Esse trabalhador vai ter a impressão de q os partidos que deveriam, supostamente, defender seus interesses de classe, estão de sacanagem com a cara dele.

