entender políticas minoritárias como busca por vantagens, pq no fim das contas é o que acaba sendo mesmo. Ou existe outra explicação para pessoas brancas se declararem como pardas ou até pretas para receberem cotas, ou algum político se declarar homossexual, seja ele ou não, para receber uma vantagem política? E quem não está inserido dentro das minorias identitárias, mas tem o mínimo de caráter de não cometer estas falsidades, tmbm não vai ficar satisfeito. E toda essa explicação até aqui, tmbm serve ao entendimento de pq os pais da classe trabalhadora não querer q o filho seja homossexual, ou de pq prefere um homem, pq os pais querem que ele tenha mais chances de vencer na selva do capitalismo. É uma questão cultural, mas é um desdobramento do nosso modelo de produção social, o capitalismo. 

Essas questões só podem ser resolvidas com a revolução socialista, e a revolução vai ser da classe trabalhadora UNIDA, ou não vai ser. Políticas identitárias servem apenas para dividir os trabalhadores, por isso mesmo a pergunta, se a questão identitária realmente veio da classe trabalhadora.', 'authorDisplayName': 'Alexandre Cerqueira', 'authorProfileImageUrl': 'https://yt3.ggpht.com/ytc/AGIKgqPlh4U0H-zYlyY1na374w90ag6NtGPJLO4om0ZQkw=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UCczd3JjwypJDMDKMIaxK3dg', 'authorChannelId': {'value': 'UCczd3JjwypJDMDKMIaxK3dg'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 1, 'publishedAt': '2022-10-03T21:37:35Z', 'updatedAt': '2022-10-03T21:37:35Z'}}, 'canReply': True, 'totalReplyCount': 0, 'isPublic': True}
